import React, { Component } from 'react'
import Toolbar from '@material-ui/core/Toolbar';
import Link from '@material-ui/core/Link';

export default class Blog extends Component {
    render() {
        return (
            <div>
                     <Toolbar component="nav" variant="dense" >
                        <Link
                            color="inherit"
                            noWrap
                            variant="body2"
                            href="#"
                        >
                            Tab
                        </Link>
                    </Toolbar>
            </div>
        )
    }
}
